INSERT INTO `animo_animes` VALUES (1, 'Boku No Hero Academia', 'boku-no-hero-academia', 'Por toda a sua vida, Izuku sonhou ser um heroi — um objetivo ambicioso para qualquer um, mas especialmente desafiador para um garoto sem superpoderes. Isso mesmo: em um mundo onde 80% da população tem algum tipo de Dom especial, Izuku teve a má sorte de nascer completamente normal. Mas isso não vai impedi-lo de se matricular em uma das academias de herois mais prestigiosas do mundo.', '/cover.jpg?Z79QXo6Cad2Kqib03PQc', 'Kōhei Horikoshi', '2018-06-21 21:25:14', '2018-05-25 19:56:18', '0', '2016', 'acao,comedia,shounen,superpoder,vida-escolar', 3, 0, '2018-06-21 21:25:14', 308, 308, '2018-06-28 21:25:14');
INSERT INTO `animo_animes` VALUES (2, 'Rakudai Kishi No Cavalry', 'rakudai-kishi-no-cavalry', 'Os Cavaleiros Mágicos, usuários de magia modernos que lutam com armas convertidas de suas almas. Kurogane Ikki frequenta uma escola para esses Cavaleiros Mágicos, mas é o \"Cavaleiro Fracassado\" ou \"O Pior\" que falhou por não ter habilidades mágicas. No entanto, certo dia, ele é desafiado para um duelo por Stella, uma princesa estrangeira e a aluna número um. Neste duelo, o perdedor deve obedecer o vencedor pelo resto da vida.', '/cover.jpg?0qkWRbOu4uUlcpnYr1FQ', 'Riku Misora', '2018-06-21 22:50:27', '2018-05-26 17:12:53', '1', '2015', 'acao,ecchi,fantasia,vida-escolar', 4, 0, '2018-06-21 22:50:27', 44, 44, '2018-06-28 22:50:27');
INSERT INTO `animo_animes` VALUES (3, 'Nanatsu no Taizai', 'nanatsu-no-taizai', 'Os “sete pecados capitais”, um grupo de cavaleiros malignos que conspiraram para derrubar o Reino da Britânia, foi dito ter sido erradicado pelos cavaleiros sagrados, embora alguns afirmam que eles ainda vivem. Dez anos depois, os cavaleiros sagrados encenaram um golpe de estado e assassinaram o rei, tornando-se os novos e tirânicos governantes do Reino. Elizabeth, a única filha do rei, parte em uma jornada para encontrar os “sete pecados capitais”, e para alistar sua ajuda em tomar de volta o Reino.', '/cover.jpg?q6IRsfDp9RcBMzBMsqNK', 'Nakaba Suzuki', '2018-06-21 23:17:35', '2018-05-26 18:06:05', '0', '2012', 'acao,aventura,demonio,magia,sobrenatural', 2, 0, '2018-06-21 23:17:35', 379, 379, '2018-06-28 23:17:35');
INSERT INTO `animo_animes` VALUES (4, 'Black Clover', 'black-clover', 'Num mundo onde magia é tudo, Asta e Yuno são abandonados em uma igreja no mesmo dia. Enquanto Yuno possui poderes mágicos excepcionais, Asta é a única pessoa do mundo todo desprovida desse dom. Aos quinze anos, ambos recebem grimórios - livros mágicos que amplificam os poderes do detentor. Asta recebe um raro grimório de anti-magia, capaz de negar e repelir os feitiços do oponente. Dois opostos que nutrem uma rivalidade amigável, Yuno e Asta estão prontos para encarar os mais difíceis desafios para conquistar seu sonho em comum: tornar-se o Rei dos Feiticeiros. Desistir não é opção!', '/cover.jpg?vYl4mmR4CagG1il9CXJJ', 'Yuuki Tabata', '2018-06-21 21:52:28', '2018-05-27 14:21:36', '0', '2017', 'acao,comedia,fantasia,shounen', 5, 0, '2018-06-21 21:52:28', 176, 176, '2018-06-28 21:52:28');
INSERT INTO `animo_animes` VALUES (5, 'Another', 'another', 'Aquela turma da escola guardava um segredo proibido de se contar... Na primavera de 1998, quando o Sakakibara (15 anos) foi transferido para a Escola de Ensino Fundamental Yomiyama do Norte, ele sentia que uma sensação estranha pairando no ar, lhe parecia como um temor por parte de seus colegas. Até que então, o Kouichi é atraído por uma garota misteriosa chamada Mei Misaki. Ele tenta se aproximar dela para desvendar um pouco daquele seu mistério, mas conforme ele se aproxima um desastre que ele jamais imaginara ocorre! O que há de errado neste \"mundo\"?!', '/cover.jpg?PPwRXkQdpJ4kHjXPbf7X', 'Kirika', '2018-06-20 18:03:05', '2018-05-29 00:24:09', '1', '2012', 'misterio,terror,thriller,vida-escolar', 1, 0, '2018-06-20 18:03:05', 48, 48, '2018-06-27 18:03:05');
INSERT INTO `animo_animes` VALUES (6, 'Shingeki No Kyojin', 'shingeki-no-kyojin', 'Attack on Titan - Eren Jaeger jurou eliminar todos os Titãs, mas em uma batalha desesperada ele se torna aquilo que mais odeia. Com seus novos poderes, ele luta pela liberdade da humanidade, combatendo os monstros que ameaçam seu lar. Mesmo depois de derrotar a Titã Fêmea, Eren não consegue descansar; Uma horda de Titãs se aproximam da Muralha Rose e a batalha em nome da humanidade continua!', '/cover.jpg?hBUdY5DAbySg75oXQN4Z', 'Hajime Isayama', '2018-06-21 22:06:02', '2018-05-29 00:39:21', '0', '2013', 'acao,drama,fantasia,superpoder,terror', 1, 0, '2018-06-21 22:06:02', 133, 133, '2018-06-28 22:06:02');
INSERT INTO `animo_animes` VALUES (7, 'One Punch Man', 'one-punch-man', 'Nesta nova comédia de ação, tudo sobre o jovem chamado Saitama parece ser \"NA MÉDIA\", desde sua expressão sem vida, sua cabeça careca e seu físico nada impressionante. No entanto, esse cara que parece normal não tem seu problema normal... Na verdade ele é um super-herói que está procurando oponentes poderosos! O problema é que toda vez que encontra um candidato promissor, ele acaba com sua raça em apenas um soco. Será que Saitama conseguirá finalmente encontrar um vilão forte o bastante para desafiá-lo? Siga Saitama em suas bagunças hilárias enquanto busca por malvados para desafiar!', '/cover.jpg?FlYHDarjncGkxaMq7MDS', 'One', '2018-06-20 17:36:15', '2018-05-29 23:21:41', '1', '2015', 'acao,comedia,ficcao-cintifica,seinen,superpoder', 5, 0, '2018-06-20 17:36:15', 47, 47, '2018-06-27 17:36:15');
INSERT INTO `animo_animes` VALUES (8, 'Shokugeki No Souma', 'shokugeki-no-souma', 'O sonho de Yukihira Souma é se tornar um chef no restaurante de seu pai e superar a culinária dele. Mas assim que Yukihira se forma no ensino fundamental, seu pai, Jouichirou, fecha o restaurante para ir cozinhar na Europa. Apesar de estar para baixo, o espírito lutador de Souma reacende quando seu pai o desafia a sobreviver numa escola de culinária de elite onde só 10% dos alunos se formam. Será que Souma sobreviverá?', 'cover.jpg?t=VbCtfvFoFGAJvkvQWZzt1527640044', 'Yuto Tsukuda', '2018-06-21 22:52:51', '2018-05-29 23:42:55', '0', '2015', 'ecchi,shounen,vida-escolar', 5, 0, '2018-06-21 22:52:51', 269, 269, '2018-06-28 22:52:51');
INSERT INTO `animo_animes` VALUES (9, 'Hataraku Maou-sama', 'hataraku-maou-sama', 'O Rei Demônio Sadao estava a apenas um passo para a conquista do mundo, mas acabou sendo derrotado pela heroína Emilia e forçado a ir para outro mundo: A Terra dos tempos atuais. Sadao acaba precisando virar um freelancer em uma rede de fast food para conseguir sobreviver e pagar suas despesas. E bem, imagine o que isso vai se tornar?\r\nCriado e dirigido por Machida, Touko e Hosoda, Naoto, Hataraku Maou-sama ((The Devil Is A Part-Timer!)) foi ao ar em 2013 com animação do estúdio White Fox.', '/cover.jpg?MtqeTTXkaqjoQjpHSjCb', 'Satoshi Wagahara', '2018-06-21 18:18:41', '2018-05-30 15:12:46', '1', '2013', 'acao,aventura,fantasia,romance,shounen', 2, 0, '2018-06-21 18:18:41', 28, 28, '2018-06-28 18:18:41');
INSERT INTO `animo_animes` VALUES (10, 'Kiss X Sis', 'kiss-x-sis', 'KissxSis conta a história de Keita Suminoe, um jovem estudante do ensino fundamental. Ele está vivendo em uma casa com seus pais e suas meio-irmãs gêmeas, Ako e Riko, que o beijam e o assediam sempre competindo para ver quem mostra mais amor por ele. Embora se considerem irmãos eles não compartilham relação sanguínea; seus pais se casaram enquanto eles estavam na infância. Ainda assim, a relação incomoda Keita profundamente, já que seus pais permitem essa relação, e visto que foram criados juntos, e escandaliza à grande parte dos que vêm a saber desta. As gêmeas, contudo, são insistentes, e (Continua ... ) KissxSis conta a história de Keita Suminoe, um jovem estudante do ensino fundamental. Ele está vivendo em uma casa com seus pais e suas meio-irmãs gêmeas, Ako e Riko, que o beijam e o assediam sempre competindo para ver quem mostra mais amor por ele. Embora se considerem irmãos eles não compartilham relação sanguínea; seus pais se casaram enquanto eles estavam na infância. Ainda assim, a relação incomoda Keita profundamente, já que seus pais permitem essa relação, e visto que foram criados juntos, e escandaliza à grande parte dos que vêm a saber desta. As gêmeas, contudo, são insistentes, e fazem o possível e o impossível para ficar com ele. Nessa conjuntura, entram outros personagens que possuem esse mesmo interesse, e a trama se desenrola em cima da disputa por Keita. ( Ocultar )\r\nCriado e dirigido por Bow Ditama e Muneori Nawa, Kiss X Sis () foi ao ar em 2008 com animação do estúdio Feel.', '/cover.jpg?lWNYvElVVPIANKaEHMnE', 'Bow Ditama', '2018-06-21 06:18:57', '2018-05-30 16:14:18', '1', '2008', 'comedia-romantica,ecchi,harem,seinen,vida-escolar', 2, 0, '2018-06-21 06:18:57', 62, 62, '2018-06-28 06:18:57');
INSERT INTO `animo_animes` VALUES (11, 'Tokyo Ghoul', 'tokyo-ghoul', 'O suspense de horror / fantasia sombria história é definida em Tóquio, que é assombrado pelo misterioso \"fantasmas\" que estão devorando seres humanos. As pessoas estão tomado pelo medo destes fantasmas cujas identidades são mascarados em mistério. Um estudante universitário comum chamado Kaneki encontra Rize, uma menina que é um ávido leitor como ele, no café que frequenta. Pouco ele percebe que seu destino irá mudar durante a noite.', 'cover.jpg?t=ARqc0AjsssIuuOKfqFPs1527698723', 'Sui Ishida, Shin Towada', '2018-06-21 20:58:51', '2018-05-30 16:31:52', '0', '2012', 'acao,drama,sobrenatural,suspense,terror', 2, 0, '2018-06-21 20:58:51', 174, 174, '2018-06-28 20:58:51');
INSERT INTO `animo_animes` VALUES (12, 'Masamune-kun no Revenge', 'masamune-kun-no-revenge', 'Quando criança, Masamune Makabe sofreu muito nas mãos da rica e bela Aki Adagaki, que o apelidou de \"Porquinho\" devido à sua aparência rechonchuda. Procurando vingança contra a atormentadora, Masamune se esforça para melhorar a si mesmo e volta como um estudante do ensino médio incrivelmente bonito, mas narcisista. Quando ele encontra Aki novamente, ele está preparado para sua vingança. Com a ajuda da empregada da garota rica, Yoshino Koiwai, Masamune lentamente começa a construir um relacionamento com Aki, planejando quebrar seu coração quando chegar a hora certa. No entanto, conforme sua amizade com Aki cresce, Masamune passa a questionar os objetivos de seu plano maléfico, e se concretizá-los é o que seu coração realmente deseja.', '/cover.jpg?RLk4vgBErlp9fXJtk2un', 'Hazuki Takeoka', '2018-06-21 22:47:50', '2018-05-31 03:14:07', '1', '2017', 'comedia,harem,romance,shounen,vida-escolar', 4, 0, '2018-06-21 22:47:50', 42, 42, '2018-06-28 22:47:50');
INSERT INTO `animo_animes` VALUES (13, 'Rokudenashi Majutsu Koushi To Akashic Records', 'rokudenashi-majutsu-koushi-to-akashic-records', 'Sistina vai a uma academia mágica para melhorar suas habilidades com artes mágicas, esperando resolver o mistério do enigmático Castelo no Céu. Depois da aposentadoria de sua professora predileta, o substituto, Glen, acaba sendo um vagabundo, preguiçoso e incompetente instrutor. Como é que Glen foi escolhido a dedo pelo maior mago da academia?!', '/cover.jpg?Th5t7S1mqXRBJMgENKYK', 'Tarou Hitsuji', '2018-06-21 11:59:38', '2018-05-31 03:46:07', '1', '2017', 'acao,fantasia,harem,magia,vida-escolar', 4, 0, '2018-06-21 11:59:38', 50, 50, '2018-06-28 11:59:38');
INSERT INTO `animo_animes` VALUES (14, 'Busou Shoujo Machiavellianism', 'busou-shoujo-machiavellianism', 'A Academia Aichi Private Symbiosis era originalmente uma escola secundária para meninas de classe alta. Quando se tornou mista, as meninas, por medo, pediram autorização para trazer armas para à escola. Depois de muitas gerações, as cinco espadas acabaram se tornando um grupo que corrigia estudantes problemáticos e a academia começou a aceitar proativamente esses alunos para corrigi-los. Fudou Nomura foi enviado para essa escola depois de fazer parte de uma briga enorme. O que ele vai fazer quando as únicas opções que tem depois de se matricular é ser expulso dessa escola ou ser corrigido de maneira igual ao resto dos estudantes do sexo masculino... sendo forçados a se vestir e agir como uma menina!', 'cover.jpg?t=lveFvBplEET8LO1rMYRh1527738600', 'Yuuya Kurokami', '2018-06-21 22:32:21', '2018-05-31 03:49:26', '1', '2017', 'comedia,harem,shounen,vida-escolar', 4, 0, '2018-06-21 22:32:21', 59, 59, '2018-06-28 22:32:21');
INSERT INTO `animo_animes` VALUES (15, 'Dragon Ball Super', 'dragon-ball-super', 'Depois de derrotar Majin Buu, a vida está pacífica, mais uma vez. Pedido por Chi-chi para ganhar dinheiro, Goku trabalha tanto quanto quer treinar ainda mais. Contudo, enquanto a paz na Terra reinava, em outro ponto do universo, um poderoso inimigo despertava de seu sono que durou mais de três décadas: este era Bills. Com um poder inigualável, capaz de destruir universos, Bills se revelou ser o deus da destruição. E num futuro apocalíptico onde vive Trunks, sua mãe é morta e Mai por um ser chamado Black que se assimila com Goku e tem causado caos ao seu mundo. Trunks viaja no tempo para escapar de Black e revê seus amigos, mas Black o segue em que tem uma luta com Goku. A luta entre Goku e Black é interrompida e antes de Black regressar a sua linha temporal, ele destrói a máquina do tempo de Trunks, o prendendo no presente.', '/cover.jpg?UNEANuV9gPigAlvnYpYX', 'Akira Toriyama', '2018-06-21 22:48:25', '2018-06-01 21:04:16', '0', '2015', 'acao,artes-marciais,aventura,shounen', 2, 0, '2018-06-21 22:48:25', 159, 159, '2018-06-28 22:48:25');
INSERT INTO `animo_animes` VALUES (18, 'Mirai Nikki', 'mirai-nikki', 'Yukiteru Amano é um garoto comum, que tem uma vida não muito agitada. É o tipo de pessoa que se exclui da escola e dos amigos e que prefere ficar o dia inteiro mexendo em seu celular. Não que isso seja muito diferente da realidade que vivemos hoje, mas Yukiteru tem um motivo em especial para fazer isso: seu celular é seu diário, e nele descreve tudo que acontece em seu dia-a-dia. Porém o lado \"estranho\" de Yukiteru não para por aí. O garoto é tão recluso que acaba entrando em um mundo \"dentro de seu pensamento\". Ou ao menos (Continua ... ) Yukiteru Amano é um garoto comum, que tem uma vida não muito agitada. É o tipo de pessoa que se exclui da escola e dos amigos e que prefere ficar o dia inteiro mexendo em seu celular. Não que isso seja muito diferente da realidade que vivemos hoje, mas Yukiteru tem um motivo em especial para fazer isso: seu celular é seu diário, e nele descreve tudo que acontece em seu dia-a-dia. Porém o lado \"estranho\" de Yukiteru não para por aí. O garoto é tão recluso que acaba entrando em um mundo \"dentro de seu pensamento\". Ou ao menos era isso que ele pensava, que tudo não passava de um sonho. Um dia, em um desses \"sonhos\", Yukiteru acaba sendo convidado para um ?jogo? pelo Deus Ex Machina, criatura soberana criada dentro da mente do garoto. Achando que tudo não passava de um delírio, o garoto acorda e percebe que seu celular tinha anotações que não eram dele, que relatavam o futuro! O tal Deus Ex Machina não era um delírio, afinal, e agora Yukiteru é o portador de um diário do futuro (Mirai Nikki) e terá que proteger tal item até a morte. Isso mesmo: caso o celular seja destruído, Yukiteru também será morto. ( Ocultar )\r\nCriado e dirigido por Sakae Esuno e Naoto Hosoda, Mirai Nikki foi ao ar em 2011 com animação do estúdio Asread.', '/cover.jpg?pSRoGBUwaD1pNUv8PbwZ', 'Sakae Esuno', '2018-06-21 18:16:26', '2018-06-04 11:27:44', '1', '2011', 'acao,misterio,shounen,sobrenatural,suspense,thriller', 6, 0, '2018-06-21 18:16:26', 116, 116, '2018-06-28 18:16:26');
INSERT INTO `animo_animes` VALUES (19, 'Naruto Shippuden', 'naruto-shippuden', 'Dois anos e meio se passaram após a partida de Uzumaki Naruto e Jiraiya da vila de Konoha, para um treinamento a parte com Naruto. Logo ao voltar à vila os primeiros a encontrá-lo foram Sakura e Konohamaru. Agora Naruto e seus amigos não tem apenas que se preocupar com o resgate de Sasuke, mas também com uma organização chamada Akatsuki, que está atrás dos Jinchuurikis (ninjas que carregam um Bijuu em seus corpos, junto a isso inumeros outros acontecimentos ocorrem ao longo da série.', '/cover.jpg?txS4zFAA5abwxeG7bnPm', 'Masashi Kishimoto', '2018-06-21 22:23:28', '2018-06-04 12:26:32', '1', '2007', 'acao,artes-marciais,comedia,shounen,superpoder', 6, 0, '2018-06-21 22:23:28', 529, 529, '2018-06-28 22:23:28');
INSERT INTO `animo_animes` VALUES (20, 'Megalo Box', 'megalobox', 'Obra conta a história de Joe Yabuki, um jovem que vive arranjando brigas, roubando, trapaceando e mentindo. No entanto, sua força e agilidade em suas brigas de rua despertam a atenção de Danpei, um ex-boxeador, que vê em Joe o potencial para se tornar um grande boxeador, e talvez um campeão.', '/cover.jpg?cmeLbtBIrOQzf6qzz2RE', 'Chiba Tetsuya e Moriyama You', '2018-06-21 21:52:31', '2018-06-04 21:17:36', '0', '2018', 'acao,esporte,shounen,slice-of-life', 7, 0, '2018-06-21 21:52:30', 40, 40, '2018-06-28 21:52:31');
INSERT INTO `animo_animes` VALUES (21, 'Sword Art Online', 'sword-art-online', 'Em um futuro próximo, foi lançado um Jogo de Realidade Virtual em Massa para Múltiplos Jogadores Online (VRMMORPG) chamado Sword Art Online, onde seus jogadores controlam seus personagens com o próprio corpo usando um dispositivo tecnológico chamado: NerveGear. Um dia, os jogadores descobrem que não podem sair do jogo, pois o criador do jogo os mantêm presos a menos que eles cheguem ao 100º andar da Torre e derrotem o Boss final. No entanto, se eles morrerem no jogo, morrerão também na vida real. A luta pela sobrevivência começa agora.', '/cover.jpg?tC7bj0w3nCZUqQ0SMEqS', 'Reki Kawahara', '2018-06-21 22:24:02', '2018-06-05 04:04:37', '1', '2012', 'acao,aventura,fantasia,jogos,seinen,shounen', 1, 0, '2018-06-21 22:24:02', 252, 252, '2018-06-28 22:24:02');
INSERT INTO `animo_animes` VALUES (22, 'Boruto: Naruto Next Generations', 'boruto-naruto-next-generations', 'Uzumaki Boruto, filho de Uzumaki Naruto, o Sétimo Hokage, se inscreveu na Academia Ninja para aprender a ser um verdadeiro ninja. Os outros estudantes o ignoram por ser \"apenas o filho do Hokage\", mas a paixão e a personalidade do Boruto vai acabar com todos esses preconceitos. Quando uma série de misteriosos eventos começa a se desenrolar, cabe a Boruto e seus novos amigos a investigá-los. Como um tornado, Boruto entra no coração de todos: sua história está prestes a começar!', '/cover.jpg?nv2lkEZgnfWYM7YpKk3F', 'Masashi Kishimoto, Ukyo Kodachi', '2018-06-21 22:48:02', '2018-06-07 17:25:51', '0', '2016', 'acao,artes-marciais,aventura,shounen,superpoder', 5, 0, '2018-06-21 22:48:02', 186, 186, '2018-06-28 22:48:02');
INSERT INTO `animo_animes` VALUES (23, 'Death Note', 'death-note', 'Um estudante japonês encontra um caderno misterioso e descobre ter poderes para matar todas as pessoas cujos nomes forem escritos no caderno.', '/cover.jpg?LsPAZDGvW8g04thQorzU', 'Tsugumi Ohba', '2018-06-21 16:17:37', '2018-06-08 05:39:29', '1', '2006', 'acao,policial,suspense,terror,thriller', 2, 0, '2018-06-21 16:17:37', 11, 11, '2018-06-28 16:17:37');
