INSERT INTO `animo_animes_seasons_episodes` VALUES (50, 'Asta e Yuno', 4, 1, '6', 'http://www.blogger.com/video-play.mp4?contentId=f48c8557cc7ed744', 'black-clover/episodes/1_1.jpg?vlY1hQzFyRa3ptju3zNN', '2018-06-17 23:34:31', '2018-05-27 14:38:12', 0, '00:23:49', 2, 'Asta e Yuno foram criados juntos, mas, quinze anos depois, o primeiro é incapaz de usar magia, num mundo onde magia significa tudo,', 'black-clover/episodes/1_1_poster.jpg?KPBq1cMrrCdUiTQ0EzGn');
INSERT INTO `animo_animes_seasons_episodes` VALUES (51, 'A Promessa dos Meninos', 4, 2, '6', 'http://www.blogger.com/video-play.mp4?contentId=c6ea83875b6f87d', 'black-clover/episodes/1_2.jpg?Tr2df0QVe6U9gtomBhC5', '2018-05-27 20:26:42', '2018-05-27 14:49:53', 0, '00:23:49', 1, 'O grimório de Yuno é um grimório lendário com um trevo de quatro folhas. Um ladrão chamado Revchi quer roubá-lo, e Asta vai ao auxílio do amigo e rival.', 'black-clover/episodes/1_2_poster.jpg?MrPteG5OHYPmygecFNXZ');
INSERT INTO `animo_animes_seasons_episodes` VALUES (52, 'Para a Capital Real do Reino Clover!', 4, 3, '6', 'http://www.blogger.com/video-play.mp4?contentId=45e606bf67fc02d3', 'black-clover/episodes/1_3.jpg?sNHC7KweLWEXAiNXDDyY', '2018-05-27 20:30:25', '2018-05-27 20:23:40', 0, '00:23:49', 0, 'Asta e Yuno partem em uma jornada para a capital real do Reino Clover para realizar o exame de admissão dos Cavaleiros Mágicos', 'black-clover/episodes/1_3_poster.jpg?h5kr1L08kiMPJ7YhVRMQ');
INSERT INTO `animo_animes_seasons_episodes` VALUES (53, 'O Exame de Admissão Para os Cavaleiros Mágicos!', 4, 4, '6', 'http://www.blogger.com/video-play.mp4?contentId=f05e83a52b3f9bdb', 'black-clover/episodes/1_4.jpg?8UhzYwOLSsoh6eOOnOWA', '2018-05-29 22:13:50', '2018-05-27 20:32:21', 0, '00:23:49', 2, 'Asta e Yuno seguem para o coliseu da capital real para prestar o exame de admissão dos Cavaleiros Mágicos', 'black-clover/episodes/1_4_poster.jpg?wq3ZkUfvszy10sgy3W0S');
INSERT INTO `animo_animes_seasons_episodes` VALUES (54, 'O Caminho Para o Rei Mago', 4, 5, '6', 'http://www.blogger.com/video-play.mp4?contentId=524f87b2415bc8a3', 'black-clover/episodes/1_5.jpg?CehKwOuLXwUIH4WO33Ct', '2018-05-27 22:34:28', '2018-05-27 20:34:45', 0, '00:23:49', 1, 'O exame de admissão chega ao fim. Chegou a hora dos capitães escolherem que candidatos desejam em seus esquadrões.', 'black-clover/episodes/1_5_poster.jpg?cd77rVTuTqwKZAaduffm');
